inline auto get_rook_moves(const size_t square, const Bitboard blockers) -> Bitboard {
    size_t offset = rook_offset[square];
    Bitboard mask = rook_mask[square].value;
    size_t index = offset + _pext_u64(blockers.value, mask.value);
    return rook_moves[index];
}

inline auto get_bishop_moves(const size_t square, const Bitboard blockers) -> Bitboard {
    size_t offset = bishop_offset[square];
    Bitboard mask = bishop_mask[square].value;
    size_t index = offset + _pext_u64(blockers.value, mask.value);
    return bishop_moves[index];
}
